import Layout from "./components/MyLayout";
import Head from "next/head";
import GlobalStyles from "./style/GlobalStyles";

const Index = () => (
  <div>
    <Head>
      <style>{`
        body {
          margin: 0;
        }
      `}</style>
    </Head>
    <Layout>
      <h1>over-</h1>
      <h1>duB</h1>
      <div></div>
      <h2>WEB DEV.</h2>
    </Layout>
    {GlobalStyles}
  </div>
);

export default Index;
